import React from 'react';
import EmailItem from "../components/EmailItem";
import { greetings, farewells, requests, names } from "../emailTemplates.ts";
import { bannerList, badBannerList } from "../bannerTemplates.ts";

const banners = [...bannerList, ...badBannerList];

function generateAdvertisementRequest(mail: { title: string, text: string }): string {
    const greeting = greetings[Math.floor(Math.random() * greetings.length)];
    const request = requests[Math.floor(Math.random() * requests.length)];
    const farewell = farewells[Math.floor(Math.random() * farewells.length)];

    // Генерация сообщения
    const message = `
        ${greeting}. ${request}
        Заголовок баннера: ${mail.title}
        Текст баннера: ${mail.text}
        <br>
        ${farewell}
    `;

    return message;
};

function rand(a: number, b: number): number {
    return Math.floor(Math.random() * (b - a + 1) + a);
}

const generatenName = () => {};

const generateEmails = () => {
    const emails = [];
    for (let i = 0; i < 4; i++) {
        const banner = banners[Math.floor(Math.random() * banners.length)];

        emails.push({
            name: generatenName(),
            time: `${ rand(1, 30) } часа назад`,
            text: generateAdvertisementRequest(banner),
            cost: rand(14, 80),
            isNew: true,
            isBab: badBannerList.includes(banner),
        })
    }
    return emails;
};


function Email() {
    return (
        <div className="tab">
            <div>
                {
                    emails.map((email, index) => (
                        <EmailItem
                            key={index}
                            {...email}
                        />
                    ))
                }
            </div>
        </div>
    );
}

export default Email;
